Spring in the Dolomites 🌸 I’ve been so many times to the Dolomites, but there is so much I still need to see. Last week I was invited by @visitsouthtyrol to visit some less known yet beautiful spots in Val Gardena. We spent the weekend exploring, shooting in awesome locations, biking our way around and, of course, eating 😋 The only downside? It was only for a few days, enough to get me itchy to go back and explore for a few weeks 😁

All the images in this collection are new, which one do you like the most? My fav are number 1 and 3!

